import React, { Component } from 'react';
import {BrowserRouter,Switch, Route,NavLink} from 'react-router-dom'

//COMPONENTS
import Order from './Order';
import EditLocation from './EditLocation';
import CreateOrder from './CreateOrder';

export class Orders extends Component {
  render() {
    return (
      <div className="orders">
            <h3 className="orders-title">LIST OF ORDERS AND DELIVERY DETAILS</h3>
            <Order/>
            <BrowserRouter>
            <button ><NavLink to="/update_location" >EDIT DESTINATION</NavLink></button>
            <button ><NavLink to="/create_order" >CREATE ORDER</NavLink></button>
            <Switch>
                <Route path="/update_location"  component={EditLocation}/>
                <Route path="/create_order" component={CreateOrder} />
            </Switch>
            </BrowserRouter>
      </div>
    )
  }
}

export default Orders;
